import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import logo from '../assests/basilurlogo.png'; // Import logo
import { FaSearch, FaTasks, FaCheckCircle, FaFileUpload, FaUsers } from 'react-icons/fa'; // Import icons

const Layout = ({ children }) => {
  const location = useLocation();

  const sections = {
    inProgress: { path: '/in-progress', label: 'In Progress', icon: <FaTasks /> },
    completed: { path: '/completed', label: 'Completed', icon: <FaCheckCircle /> },
    addDocument: { path: '/add-document', label: 'Add Document', icon: <FaFileUpload /> },
    viewFreightAgents: { path: '/view-freight-agents', label: 'View Freight Agents', icon: <FaUsers /> },
  };

  const isSectionActive = (path) => location.pathname === path;

  return (
    <div
      className="font-sans min-h-screen flex flex-col"
      style={{
        backgroundColor: '#FFFFFF',
        margin: 0,
        padding: 0,
      }}
    >
      {/* Header */}
      <header
        className="flex items-center justify-center p-2 mx-auto"
        style={{
          backgroundColor: '#191919',
          color: '#FFFFFF',
          borderRadius: '30px',
          height: '50px',
          width: '85%',
          marginTop: '20px',
          boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
          paddingTop: '5px',
          paddingBottom: '5px',
        }}
      >
        <img
          src={logo}
          alt="Logo"
          className="mr-4"
          style={{
            width: '40px',
            height: '40px',
            objectFit: 'contain',
          }}
        />
        <h1
          className="text-lg font-bold flex-1 text-center"
          style={{
            color: '#FFFFFF',
          }}
        >
          Freight Allocation
        </h1>
      </header>

      {/* Navigation Bar */}
      <div
        className="mt-4 w-85%"
        style={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
        }}
      >
        <ul className="flex space-x-4 justify-center items-center">
          <li>
            <Link to="/home">
              <button
                className="text-lg font-medium text-black hover:text-orange-500 hover:underline"
                style={{ transition: 'all 0.3s ease' }}
              >
                Home
              </button>
            </Link>
          </li>
          <span className="text-orange-500">|</span>
          <li>
            <Link to="/add-freight-agent">
              <button
                className="text-lg font-medium text-black hover:text-orange-500 hover:underline"
                style={{ transition: 'all 0.3s ease' }}
              >
                Add Freight Agent
              </button>
            </Link>
          </li>
          <span className="text-orange-500">|</span>
          <li>
            <Link to="/add-freight-coordinator">
              <button
                className="text-lg font-medium text-black hover:text-orange-500 hover:underline"
                style={{ transition: 'all 0.3s ease' }}
              >
                Add Freight Coordinator
              </button>
            </Link>
          </li>
          <span className="text-orange-500">|</span>
          <li>
            <Link to="/add-main-user">
              <button
                className="text-lg font-medium text-black hover:text-orange-500 hover:underline"
                style={{ transition: 'all 0.3s ease' }}
              >
                Add Main User
              </button>
            </Link>
          </li>
        </ul>
      </div>

      {/* Buttons and Search Bar */}
      <div
        className="flex justify-between items-center mt-1 space-x-4"
        style={{
          width: '85%',
          margin: '0 auto',
        }}
      >
        {/* Buttons */}
        <div className="flex space-x-4">
          {Object.entries(sections).map(([key, { path, label, icon }]) => (
            <Link key={key} to={path}>
              <button
                className={`flex items-center px-4 py-2 rounded-full text-black ${
                  isSectionActive(path) ? 'font-bold text-orange-500' : 'font-medium'
                } hover:font-bold hover:text-orange-500`}
                style={{
                  transition: 'all 0.3s ease',
                }}
              >
                <span
                  className={`mr-2 text-lg ${
                    isSectionActive(path) ? 'visible text-orange-500' : 'invisible'
                  } hover:visible hover:text-orange-500`}
                >
                  {icon}
                </span>
                {label}
              </button>
            </Link>
          ))}
        </div>

        {/* Search Bar */}
        <div className="flex items-center border border-gray-300 rounded-full px-4 py-2 w-full max-w-md">
          <FaSearch className="text-gray-500 mr-2" />
          <input
            type="text"
            placeholder="Search"
            className="outline-none text-sm text-gray-700 w-full"
          />
        </div>
      </div>

      {/* Main Content */}
      <main className="flex-grow">{children}</main>

      {/* Footer */}
      <footer
        className="p-4 text-center mt-auto"
        style={{
          backgroundColor: 'transparent',
          color: '#191919',
          fontSize: '14px',
          marginTop: '20px',
        }}
      >
        © {new Date().getFullYear()} Freight Allocation. All Rights Reserved.
      </footer>
    </div>
  );
};

export default Layout;
